import { useState } from "react"
import { useEffect } from "react";
import { CKEditor } from '@ckeditor/ckeditor5-react';
import ClassicEditor from '@ckeditor/ckeditor5-build-classic';

import ReactHtmlParser from 'react-html-parser'; 

import Radium from 'radium';

export default function AddBlog(){
    const [textValue,setTextValue]=useState(['',])

    const addNewElement=(element)=>{
        const newTextValue=[...textValue,element];
        setTextValue(newTextValue);
    }
    const setLastIndexTextValue=(element)=>{
        if(textValue.length<=0) return;
        const newTextValue=[...textValue];
        newTextValue[newTextValue.length-1]=element;
        setTextValue(newTextValue);
    }
    const removeIndexTextValue=(index)=>{
        if(index<0) return;
        if(index>=textValue.length) return;
        
        var newtextValue=[...textValue];
        newtextValue.splice(index,1);
        setTextValue(newtextValue);
    }

    const handleOnChange=(e,editor)=>{
        const newTextValue=[...textValue];

        if(newTextValue.length<=0) return;


        setLastIndexTextValue(ReactHtmlParser(editor.getData()));

       
        //console.log(editor.getData())
    }
    const [language,setLanguage]=useState({
        blogPageTitle:'Thêm bài viết',
        
    })

    const [style,setStyle]=useState(
        {
            textCenter:{
                textAlign:'center',fontSize:'24px',fontFamily:'Source Sans Pro',
            },
            addBlog:{
                width: '80vw',
                backgroundColor: 'rgb(226, 226, 226)',
                margin:'auto',
            },
            toolsAdd:{
                display:'flex',
                justifyContent:'space-between',                
                width:'100%',
            },
            defaultImg:{
                objectFit:'cover',
                height:'100%',
            },
            

            defaultImgIcon:{
                objectFit:'cover'
            },  


            iconTools:{
                width:'30px',
                height:'30px',
                margin:'0px 10px 0px 0px',
                
            },
        }
    );
    

    const imgLink={
        textIcon:'https://cdn-icons.flaticon.com/png/128/3815/premium/3815460.png?token=exp=1637497950~hmac=b836f417222df5d095bff7a3c899bad1',
        imgIcon:'https://cdn-icons-png.flaticon.com/128/834/834096.png',
    };
    

    const upLoadImg=(url)=>{
        const element = <div style={{display:'block',height:'200px'}}><img src={url} style={style.defaultImg} alt="" /></div>;
        addNewElement(element);
    }
    useEffect(()=>{
        if(textValue.length<=0) return;
        else{
            
        }
    },[upLoadImg])

    const imgEditor=
        <div className="imgEditor">
            <input type="file"  accept="image/*" name="image" id="file" onChange={(e)=>upLoadImg(URL.createObjectURL(e.target.files[0]))} />
        </div>;

    const textEditor=
        <div className="editor" style={{position:'relative',}}>
            <CKEditor
                editor={ClassicEditor}
                onChange={handleOnChange}
            >
            </CKEditor>
        </div>;
    
    const [toolsShow,setToolsShow]=useState(
        textEditor
    )

    const changeEditor=(type)=>{
        if(type=='textEditor'){
            setToolsShow(textEditor);
        }
        if(type=='imgEditor'){
            setToolsShow(imgEditor);
        }
    }



    return(
        <div className="addBlog" style={style.addBlog}>
            <div className="addBlogTitle" style={style.textCenter}>
                <div>{language.blogPageTitle}</div>
            </div>
            {
                textValue
            }
            {toolsShow}
            

            <div style={style.toolsAdd}>
                <div style={{display:'flex',justifyContent:'left',}}>
                    <div className='iconTool' style={style.iconTools} onClick={()=>changeEditor('textEditor')}>
                        <img src={imgLink.textIcon} style={style.defaultImg} alt="" />
                    </div>
                    <div className='iconTool' style={style.iconTools} onClick={()=>changeEditor('imgEditor')}>
                        <img src={imgLink.imgIcon} style={style.defaultImg} alt="" />
                    </div>
                </div>

                <button className='iconTool' style={{display:'inline-block',}}>
                    Submit
                </button>
            </div>

        </div>
        
    )
}
